e.google.com/webstore/detail/coinstats-crypto-portfoli/fbbckponafgkennhnmgfoikfmbkiplgp" target="_blank" rel="noopener">Chrome Extension</a><a className="primary-nav    " href="https://apps.apple.com/us/app/coin-stats-crypto-portfolio/id1247849330" target="_blank" rel="noopener">Apple TV</a></div><div className="footer-group"><h3 className="group-title">COMPANY</h3><a className="primary-nav    " target="_self" href="/en/pricing/">Pricing</a><a className="primary-nav    " href="https://inomma.com/coinstatsprivacy.html" target="_blank" rel="noopener">Privacy Policy</a><a className="primary-nav    " href="https://coinstats.app/terms.html" target="_blank" rel="noopener">Terms of Use</a><a className="primary-nav    " href="https://coinstats.app/refund.html" target="_blank" rel="noopener">Refund Policy</a></div><div className="footer-group"><h3 className="group-title">CONTACT US</h3><a className="primary-nav    " href="https://help.coinstats.app/en/" target="_blank" rel="noopener">Help Center</a><a className="primary-nav    " href="https://feedback.coinstats.app/" target="_blank" rel="noopener">Feature Request</a><a className="primary-nav    " href="https://help.coinstats.app/en/articles/4437259-coinstats-advertisement-guidelines" target="_blank" rel="noopener">Advertise at CoinStats</a></div></div></div></footer>

